        # Define mappings for vowels 2 places ahead
        vowel_map = {'a': 'c', 'e': 'g', 'i': 'k', 'o': 'm', 'u': 'w',
                     'A': 'C', 'E': 'G', 'I': 'K', 'O': 'M', 'U': 'W'}
        return vowel_map.get(v, v)  # Return the shifted vowel, or the original character if not a vowel

    def encode_char(c):
        if c.isalpha():  # Check if the character is a letter
            if c.lower() in 'aeiou':  # Check if the character is a vowel
                # For vowels, shift them 2 places ahead using the map
                return shift_vowel(c)
            else:
