from heapq import heappop, heappush

def minPath(grid, k):
    N = len(grid)
    # If k is 1, we only need to find the minimum value in the grid.
    if k == 1:
        return [min(min(row) for row in grid)]

    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    heap = [(grid[i][j], i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
    visited = set()

    while heap:
        cost, x, y, path = heappop(heap)
        if (x, y, len(path)) in visited:
            continue
        visited.add((x, y, len(path)))
        if len(path) == k:
            return path
        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                newPath = path + [grid[nx][ny]]
                heappush(heap, (cost + grid[nx][ny], nx, ny, newPath))

