    if n == 0:
        return [3]
    elif n == 1:
        return [3, 1]
    elif n == 2:
        return [3, 1, 2]

    trib = [3, 1, 2]
    # Generate the Tribonacci sequence for n >= 3
    for i in range(3, n + 1):
        if i % 2 == 0:
            next_value = 1 + (i / 2)
        else:
            next_value = trib[i - 1] + trib[i - 2] + trib[i - 3]
        trib.append(int(next_value))

    return trib

