        return shifts.get(vowel, vowel)

    def swap_case(ch):
        return ch.lower() if ch.isupper() else ch.upper()

    encoded_message = ''
    for c in message:
        if c.lower() in 'aeiou':
            # Shift the vowel before swapping its case
