def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    if k == 1:
        return [min(min(row) for row in grid)]

    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    heap = []
    for i in range(N):
        for j in range(N):
            heappush(heap, (grid[i][j], i, j, [grid[i][j]]))

    while heap:
        _, x, y, path = heappop(heap)
        if len(path) == k:
            return path
        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                newPath = path + [grid[nx][ny]]
                if len(newPath) <= k:
                    heappush(heap, (newPath[-1], nx, ny, newPath))

