def tri(n):
    # Correct initialization of the Tribonacci sequence
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]

    # Initialize the sequence with correct base cases
    trib = [1, 3, 2]

    # Generate the Tribonacci sequence for n > 2
    for i in range(3, n + 1):
        if i % 2 == 0:
            next_element = 1 + i // 2
        else:
            next_element = trib[i - 1] + trib[i - 2] + trib[i - 3]
        trib.append(next_element)

    return trib

