def intersection(interval1, interval2):
    def is_prime(n):
        """Check if a number is prime."""
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start1, end1 = interval1
    start2, end2 = interval2
    # Find the maximum start point and the minimum end point to determine the intersection.
    start = max(start1, start2)
    end = min(end1, end2)
    # If there is no intersection return "NO".
    if start > end:
        return "NO"
    # Calculate the length of the intersection.
    length = end - start
    # Check if the length of the intersection is a prime number.
    return "YES" if is_prime(length) else "NO"

def match_parens(lst):
    str1, str2 = lst
    # First, check if overall they have the same number of '(' and ')'
    total_open = str1.count('(') + str2.count('(')
    total_close = str1.count(')') + str2.count(')')
    if total_open != total_close:
        return 'No'

    # Check if str1 can be the first string without causing imbalance
    balance = 0
    for char in str1:
        if char == '(':
            balance += 1
        else:
            balance -= 1
            if balance < 0:
                break  # str1 causes imbalance, no need to proceed further

    if balance >= 0:  # str1 does not cause imbalance
        # Check if str2 does not cause imbalance after str1
        for char in str2:
            if char == '(':
                balance += 1
            else:
                balance -= 1
                if balance < 0:
                    return 'No'  # str2 causes imbalance after str1
        return 'Yes'  # Neither str1 nor str2 causes imbalance

    # If str1 itself causes imbalance, check if str2 as the first string works
    balance = 0
    for char in str2:
        if char == '(':
            balance += 1
        else:
            balance -= 1
            if balance < 0:
                return 'No'  # str2 as the first string also causes imbalance

    # If we reach here, str2 does not cause imbalance as the first string
    # Check if str1 does not cause imbalance after str2
    for char in str1:
        if char == '(':
            balance += 1
        else:
            balance -= 1
            if balance < 0:
                return 'No'  # str1 causes imbalance after str2

    return 'Yes'  # str2 followed by str1 does not cause imbalance

from heapq import heappop, heappush

def minPath(grid, k):
    if k == 1:
        return [min(cell for row in grid for cell in row)]

    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    heap = [(grid[i][j], i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
    best = {}

    while heap:
        cost, x, y, path = heappop(heap)
        if (x, y, len(path)) in best and best[(x, y, len(path))] <= path:
            continue
        best[(x, y, len(path))] = path
        if len(path) == k:
            return path
        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                newPath = path + [grid[nx][ny]]
                heappush(heap, (cost + grid[nx][ny], nx, ny, newPath))

