def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if stack:
                # Before popping, check if this closing bracket creates a nested structure
                if len(stack) > 1:
                    return True
                stack.pop()
    # After going through the string, return False as no nested structure was found
    return False

