def do_algebra(operator, operand):
    stack = [operand[0]]
    for op, num in zip(operator, operand[1:]):
        if op == '+':
            stack.append(num)
        elif op == '-':
            stack.append(-num)
        elif op == '*':
            stack[-1] = stack[-1] * num
        elif op == '//':
            stack[-1] = stack[-1] // num
        elif op == '**':
            stack[-1] = stack[-1] ** num

    return sum(stack)

def get_odd_collatz(n):
    odd_numbers = set()
    while n != 1:
        if n % 2 == 1:
            odd_numbers.add(n)
        n = n * 3 + 1 if n % 2 else n // 2
        if n % 2 == 1:
            odd_numbers.add(n)  # Add odd numbers resulting from operations on even numbers
    odd_numbers.add(1)  # Ensure 1 is always included
    return sorted(odd_numbers)

